import React, { Component } from 'react';

class LatestEvent extends Component{
    render(){
        return(

    <>
     <div className="latestevent">
     <img src={'./avatars/bidcar.jpg'} style={{height:'130px',width:'100%'}} />
    <p>NSW Caravan Camping Holiday Supershow</p>
    <p>April 12, 2021 @ 10:30 pm - April 18, 2021 @ 7:30 am</p>
     </div>

   </>

        )
    }
}

export default LatestEvent ;
